import geopandas as gpd #Manipulação com gráfico e dataframes geoespaciais
import pandas as pd #Manilação de dataframes
import datetime #manipulação de data
import seaborn as sns #Criação de gráficos simples
import plotly as plt # CriaçãoGráficos interativos
import plotly.express as px #Criação de Gráficos interativos

# COMMAND ----------

# MAGIC %md
# MAGIC ##Importar Bases de Dados

# COMMAND ----------

# MAGIC %md
# MAGIC ###Importar base de dados GeoEspacial

# COMMAND ----------

# MAGIC %md
# MAGIC Primeiro precisaremos de um arquivo [Geopackage](https://forest-gis.com/2018/02/geopackage-saiba-mais-sobre-o-formato-que-pretende-substituir-o-shapefile.html/) com as coordenadas e informações necessárias do Brasil.
