# COMMAND ----------

Info.geometry[Info.query('nome == "São Paulo"').index.values.astype(int)[0]]

# COMMAND ----------

# MAGIC %md
# MAGIC ###Importar base de dados COVID-19

# COMMAND ----------

# MAGIC %md
# MAGIC Um mapa coroplético precisa informar a densidade de um dado através das cores. 
# MAGIC 
# MAGIC Nesse caso, utilizaremos a quantidade de mortes por ano confirmadas da COVID-19 no Brasil para dar essa densidade.
# MAGIC 
# MAGIC A base de dados atualizada pode ser encontrada para download no site [Brasil.IO](https://brasil.io/dataset/covid19/files/)

# COMMAND ----------

dados=pd.read_csv('/content/drive/MyDrive/Dataset_Excel_CSV/caso.csv')

# COMMAND ----------

# MAGIC %md
# MAGIC ##Análise Exploratória de Dados e Limpeza de dados

# COMMAND ----------

# MAGIC %md
# MAGIC A análise exploratória de dados busca analisar as principais características do nosso dataset de forma que seja mais fácil entender os dados, descobrir padrões e anomalias.

# COMMAND ----------

dados.head()

# COMMAND ----------

# MAGIC %md
# MAGIC Veja que temos bastante informações úteis. Porém vamos ver o que podemos utilizar.

# COMMAND ----------

# MAGIC %md
# MAGIC ###Tipos de dados

# COMMAND ----------

# MAGIC %md
# MAGIC Vamos checar se nossos dados vieram no formato correto?

# COMMAND ----------

dados.dtypes

# COMMAND ----------

# MAGIC %md
# MAGIC Veja que a data está como string. Vamos converter para facilitar algumas análises

# COMMAND ----------

dados['date']=dados['date'].astype('datetime64[ns]')

# COMMAND ----------

dados.dtypes

# COMMAND ----------

# MAGIC %md
# MAGIC ###Dados Nulos

# COMMAND ----------

# MAGIC %md
# MAGIC Antes de prosseguirmos devemos avaliar se as colunas que precisaremos usar estão preenchidas ou não.
# MAGIC 
# MAGIC Utilizaremos:
# MAGIC 
# MAGIC * date: Data de Confirmação das ocorrências.
# MAGIC * state: Sigla do estado das ocorrências.
# MAGIC * death_rate: índice de mortalidade no ranking do país.
# MAGIC * estimated_population: População estimada no dia da ocorrência.
# MAGIC * deaths: Número de mortes até o dia da ocorrência.

# COMMAND ----------

dados.isnull().sum()

# COMMAND ----------

# MAGIC %md
# MAGIC Podemos visualizar esses dados também por um mapa de calor.

# COMMAND ----------

sns.heatmap(dados.isnull(),annot=False);

# COMMAND ----------

# MAGIC %md
# MAGIC Certo. A população estimada tem alguns dados nulos. Porém lembre-se: Utilizaremos somente os últimos registro da nossa base de dados baseados nos anos visto que englobam de forma incrementam todas as variáveis que precisamos. 
# MAGIC 
# MAGIC Checaremos os dados nulos para vermos se são os últimos ou não. Para esse exemplo mostrarei apenas São Paulo, mas pode utilizar ou melhorar a lógica com base no exemplo abaixo. Utilizaremos a variável order_for_place que indica a ordem do registro, se ela for maior e não nula prosseguiremos.

# COMMAND ----------

def ChecarAnosPorEstadoNulos(estado,ano):
  return dados[(dados['estimated_population'].isnull()) &
        (dados['date'].dt.year==ano) &
        (dados['state']==estado)]\
        .sort_values('date',ascending=False)\
        .iloc[0,:]['order_for_place']

# COMMAND ----------

def ChecarAnosPorEstadoNaoNulos(estado,ano):
  return dados[(dados['estimated_population'].notnull()) &
               (dados['date'].dt.year==ano) &
               (dados['state']==estado)]\
               .sort_values('date',ascending=False)\
               .iloc[0,:]['order_for_place']

# COMMAND ----------

ChecarAnosPorEstadoNulos('SP',2020), ChecarAnosPorEstadoNaoNulos('SP',2020)

# COMMAND ----------

ChecarAnosPorEstadoNulos('SP',2021), ChecarAnosPorEstadoNaoNulos('SP',2021)

# COMMAND ----------

# MAGIC %md
# MAGIC Perfeito! Em ambos os casos o último registro do ano para o estado não foi nulo, então podemos utilizar em nosso exemplo.

# COMMAND ----------

# MAGIC %md
# MAGIC ##Preparação das bases de dados

# COMMAND ----------

# MAGIC %md
# MAGIC ###Criação de coluna com o ano

# COMMAND ----------

# MAGIC %md
# MAGIC Ótimo. Como faremos uma análise por ano, vamos criar uma coluna para distinguir isso de forma mais fácil. Ela será baseada na data de verificação da ocorrência.

# COMMAND ----------

dados['ano']=pd.DatetimeIndex(dados['date']).year

# COMMAND ----------

# MAGIC %md
# MAGIC ###Agrupar por mes e pelo último registro encontrado

# COMMAND ----------

# MAGIC %md
# MAGIC Agora que fizemos nossa análise, vamos utilizar a variável nova para agrupar nossos dados e recuperar os últimos registros de cada estado por ano

# COMMAND ----------

dados_filtados=dados.sort_values(['ano','order_for_place']).groupby(['ano','state']).tail(1).sort_values(['state','ano'])

# COMMAND ----------

dados_filtados.head()

# COMMAND ----------

# MAGIC %md
# MAGIC Vamos ver checar novamente para garantir que não temos nossas variáveis importantes nulas.

# COMMAND ----------

dados_filtados.isnull().sum()

# COMMAND ----------

# MAGIC %md
# MAGIC ###Renomeação e Filtragem de colunas

# COMMAND ----------

# MAGIC %md
# MAGIC Vamos primeiro filtrar somente pelas variáveis que precisamos

# COMMAND ----------

dados_filtados=dados_filtados[['state','deaths','ano','death_rate','estimated_population']]

# COMMAND ----------

# MAGIC %md
# MAGIC Agora veja que nossas variáveis estão em inglês. Podemos renomear elas.

# COMMAND ----------

dados_filtados.columns=['sigla','mortes','ano','indice_mortalidade','populacao_estimada']

# COMMAND ----------

# MAGIC %md
# MAGIC Faremos a filtragem na outra base também. 
# MAGIC 
# MAGIC Basicamente precisaremos da sigla do estado, geometria e nome do estado.

# COMMAND ----------

Info=Info[['sigla','geometry','nome']]

# COMMAND ----------

# MAGIC %md
# MAGIC ###Juntar as bases de dados

# COMMAND ----------

# MAGIC %md
# MAGIC Já finalizamos a maior parte da preparação das bases. Agora vamos juntá-las.
# MAGIC 
# MAGIC Como ambas tem as siglas dos estados do Brasil, faremos um **inner join** (para quem lembra do SQL).

# COMMAND ----------

BRASIL=Info.merge(dados_filtados,on='sigla',how='inner')

# COMMAND ----------

# MAGIC %md
# MAGIC Como temos 27 estados (26 + Distrito Federal) e temos 2 anos = 54 registros.

# COMMAND ----------

len(BRASIL)

# COMMAND ----------

# MAGIC %md
# MAGIC ###Modificar Sistema de Referência de Coordenadas (SRC)

# COMMAND ----------

# MAGIC %md
# MAGIC Outro ponto importante ao analisar dados geoespaciais é se atentar ao Sistema de Referência de Coordenadas (SRC), ou Coordinate Reference System (CRS), que é a maneira como os dados são representados.
# MAGIC Todas as representações da Terra, seja em sua totalidade ou parcialmente, ocorrem em uma superfície plana. O que acaba por gerar distorções, pois nosso planeta não é plano (como algumas pessoas acham) e sim um geoide, que após uma série de transformações matemáticas, é convertido no formato de elipsoide que aprendemos na escola.

# COMMAND ----------

# MAGIC %md
# MAGIC Veja a imagem abaixo: Geoide o formato original da Terra.

# COMMAND ----------

# MAGIC %md
# MAGIC ![image.png](data:image/png;base64,)

# COMMAND ----------

# MAGIC %md
# MAGIC Fonte: Knippers, Richard. Perspective view of the globe. In: geometric aspects of mapping. Enschede:
# MAGIC International Institute for Aerospace Survey and Earth Sciences, 2000. 
# MAGIC 
# MAGIC Disponível em: <http://kartoweb.itc.nl>.
# MAGIC 
# MAGIC Nota: A superfície irregular contida na figura foi exagerada para fins de clareza didática.

# COMMAND ----------

# MAGIC %md
# MAGIC Podemos atribuir um CRS com o método abaixo. Utilizaremos o [CRS WGS 84](https://pt.wikipedia.org/wiki/WGS84), que possuí o código EPSG 4326.

# COMMAND ----------

BRASIL=BRASIL.to_crs(epsg=4326)

# COMMAND ----------

# MAGIC %md
# MAGIC ###Escolher a coluna index

# COMMAND ----------

# MAGIC %md
# MAGIC Isso é muito importante para plotar gráficos com o Plotly, que os utiliza como referência. Utilizaremos o nome (estado), que é único para cada ano. 

# COMMAND ----------

BRASIL=BRASIL.set_index('nome')

# COMMAND ----------

# MAGIC %md
# MAGIC ##Plotagem do gráfico interativo Cartesiano

# COMMAND ----------

# MAGIC %md
# MAGIC Chegamos a parte final, a plotagem do gráfico. 
# MAGIC 
# MAGIC Utilizaremos o Plotly para deixá-lo mais interativo.

# COMMAND ----------

fig = px.choropleth_mapbox(
 BRASIL, #base de dados
 locations =BRASIL.index.astype(str), #Define os limites para o mapa 
 geojson = BRASIL, #Informações do gráfico
 color = "mortes", #Define qual variável será o critério da escala de cores
 hover_name = BRASIL.index.astype(str), #Nome que aparecerá na caixa ao mover o mouse 
 hover_data =["mortes",'indice_mortalidade','populacao_estimada'], #Dados que apareceram na caixa
 mapbox_style = "carto-positron", #Define um estilo cartesiano no mapa 
 center={"lat":-14, "lon": -55}, #Define os limites de plotagem 
 title = "Distribuição de mortes pela COVID-2019 no Brasil", #título do mapa
 zoom = 3, #Tamanho inicial de vizualização do mapa
 opacity = 0.5, #Opacidade das cores que apareceram no mapa
 animation_frame = 'ano' #Frame que mostrará o casos ao longo do ano
)
fig.update_geos(fitbounds = "locations", visible = False)
fig.show()

# COMMAND ----------

# MAGIC %md
# MAGIC Por fim mas não menos importante: Podemos apresentar esse gráfico de forma offline exportando ele para um HTML atráves do Plotly.

# COMMAND ----------

plt.offline.plot(fig, filename = 'mapa.html')
